class Solution:
    def pivotIndex(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        for x in range(0, len(nums) ):
            bf = sum(nums[:x])
            aft = sum(nums[x + 1:len(nums)])
            if bf == aft:
                result = x
                return result
        return -1

    def result(self, nums):
        zonghe=sum(nums)
        for x in range(0, len(nums) ):
            bf = sum(nums[:x])
            standard=bf*2+nums[x]
            if zonghe == standard:
                result = x
                return result
        return -1

    def result2(self, nums):
        #前面都超时，这个才对
        bf = 0
        zonghe = sum(nums)
        for key, value in enumerate(nums):
            if zonghe == bf * 2 + value:
                return key
            bf = bf + value
        return -1


